module.exports = [{"name":"ux-button.css","body":":host {\r\n  position: relative;\r\n  box-sizing: border-box;\r\n  overflow: hidden;\r\n  display: inline-block;\r\n  vertical-align: text-bottom;\r\n  padding: 0 10px;\r\n  padding: 0 .85em;\r\n  border-radius: 3px;\r\n  -webkit-user-select: none;\r\n  color: #ffffff;\r\n  background: #298eea;\r\n  cursor: pointer;\r\n  border-color: #298eea;\r\n  height: 3em;\r\n  line-height: 3em;\r\n  font-size: inherit; }\r\n\r\n:host(:hover) {\r\n  background: #2180d7;\r\n  color: #ffffff; }\r\n\r\n:host(:focus) {\r\n  outline: 0;\r\n  box-shadow: 0 0 0 1px white, 0 0 2px 2px #298eea; }\r\n\r\n:host(.is-spinning) {\r\n  background: #2180d7; }\r\n\r\n  .spinner {\r\n    position: absolute;\r\n    background-color: inherit;\r\n    transition: 200ms all ease-in-out;\r\n    left: 0;\r\n    top: 0;\r\n    right: 0;\r\n    opacity: 0;\r\n    bottom: 0; }\r\n\r\n  :host(.is-spinning) .spinner { \r\n    opacity: 1 }\r\n\r\n    .spinner::before {\r\n      content: '';\r\n      margin-top: -5px;\r\n      vertical-align: middle;\r\n      border-radius: 100%;\r\n      border: 2px solid #dfdfdf;\r\n      animation: rotate 0.75s 0s linear infinite;\r\n      height: 1em;\r\n      width: 1em;\r\n      display: inline-block;\r\n      animation-fill-mode: both;\r\n      border-color: white;\r\n      border-bottom-color: transparent; }\r\n\r\n@keyframes rotate {\r\n  0%   { transform: rotate(0deg)   }\r\n  50%  { transform: rotate(180deg) }\r\n  100% { transform: rotate(360deg) }\r\n}"},{"name":"ux-button","body":require('./ux-button.js').default || require('./ux-button.js'),"headers":{"needs":"[css]"}}]